import { Plugins } from '@capacitor/core';
import { useState } from 'react';
import { Event, Shopping,ShoppingItem, Teaching, TeachingLesson, } from '../data/model';


//const { Storage } = Plugins;


const dataUrl = '/assets/data/data.json';

//const [data type AppState, setData] = useState(false);
console.log("début");

export const getAppData = async () => {

  console.log("lecture du fichier data.json");

  const response = await Promise.all([
    fetch(dataUrl)]);

  console.log(response);

  const responseData = await response[0].json();

  console.log(responseData);

  const events = responseData.Event as Event[];


  const data = {
    events
  }

  console.log(data);

  console.log("fin reading data");

  return data;
}


export const loadAppData = () => async () => {

  const data = await getAppData();
  console.log(data);
  console.log("fin loading data");


}
